import React from "react";



const Input = ({ currentValue: String, onchange, onAdd: a }) => {
  return (
    <div className="inputs">
      <input
        placeholder="What needs to be done?"
        value={currentValue}
        onChange={onChange}
        onKeyDown={onAdd}
      />
    </div>
  );
};

export default Input;
